import React from "react";
import styled from "styled-components";

const FooterContainer = styled.footer`
  background: ${(props) => props.theme.colors.dark};
  color: ${(props) => props.theme.colors.white};
  padding: ${(props) => props.theme.spacing.xxl} 0
    ${(props) => props.theme.spacing.lg};
  margin-top: auto;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 ${(props) => props.theme.spacing.md};
`;

const FooterTop = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: ${(props) => props.theme.spacing.xl};
  margin-bottom: ${(props) => props.theme.spacing.xl};

  @media (max-width: ${(props) => props.theme.breakpoints.tablet}) {
    grid-template-columns: 1fr;
    gap: ${(props) => props.theme.spacing.lg};
  }
`;

const FooterSection = styled.div`
  h3 {
    font-size: 18px;
    margin-bottom: ${(props) => props.theme.spacing.md};
    color: ${(props) => props.theme.colors.primary};
  }

  ul {
    li {
      margin-bottom: ${(props) => props.theme.spacing.sm};

      a {
        color: ${(props) => props.theme.colors.gray[300]};
        transition: color 0.2s ease;

        &:hover {
          color: ${(props) => props.theme.colors.white};
        }
      }
    }
  }
`;

const FooterBottom = styled.div`
  border-top: 1px solid ${(props) => props.theme.colors.gray[700]};
  padding-top: ${(props) => props.theme.spacing.lg};
  text-align: center;
  color: ${(props) => props.theme.colors.gray[400]};
  font-size: 14px;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <FooterTop>
          <FooterSection>
            <h3>LookPick</h3>
            <ul>
              <li>
                <a href="#about">회사소개</a>
              </li>
              <li>
                <a href="#careers">채용정보</a>
              </li>
              <li>
                <a href="#press">보도자료</a>
              </li>
              <li>
                <a href="#investors">투자자정보</a>
              </li>
            </ul>
          </FooterSection>

          <FooterSection>
            <h3>고객서비스</h3>
            <ul>
              <li>
                <a href="#help">도움말</a>
              </li>
              <li>
                <a href="#contact">문의하기</a>
              </li>
              <li>
                <a href="#safety">안전정보</a>
              </li>
              <li>
                <a href="#cancellation">취소정책</a>
              </li>
            </ul>
          </FooterSection>

          <FooterSection>
            <h3>호스팅</h3>
            <ul>
              <li>
                <a href="#host">숙소 등록하기</a>
              </li>
              <li>
                <a href="#hosting-guide">호스팅 가이드</a>
              </li>
              <li>
                <a href="#host-support">호스트 지원</a>
              </li>
              <li>
                <a href="#community">커뮤니티</a>
              </li>
            </ul>
          </FooterSection>

          <FooterSection>
            <h3>정책</h3>
            <ul>
              <li>
                <a href="#terms">이용약관</a>
              </li>
              <li>
                <a href="#privacy">개인정보처리방침</a>
              </li>
              <li>
                <a href="#sitemap">사이트맵</a>
              </li>
              <li>
                <a href="#accessibility">접근성</a>
              </li>
            </ul>
          </FooterSection>
        </FooterTop>

        <FooterBottom>
          <p>&copy; 2024 LookPick. All rights reserved.</p>
        </FooterBottom>
      </FooterContent>
    </FooterContainer>
  );
};

export default Footer;
